import React from 'react'
import {GoogleMap, withGoogleMap, withScriptjs} from "@react-google-maps/api";

export const Gmap = () => {
    return (
        <GoogleMap
            defaultZoom={10}
            defaultCenter={{ lat: 55.8542404, lng: 37.4766922}}/>
    )
}

export const WrapperMap = withScriptjs(withGoogleMap(Gmap))

export default Gmap;
